import { AppBar, Toolbar, Typography, Button, Box } from "@mui/material";
import DirectionsCarIcon from "@mui/icons-material/DirectionsCar";
import AdminPanelSettingsIcon from "@mui/icons-material/AdminPanelSettings";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../components/AuthContext";

const Navbar = () => {
  const navigate = useNavigate();
  const { isLoggedIn, isAdmin, logout } = useAuth();

  const handleLogout = async () => {
    try {
      const response = await fetch("http://localhost:8000/api/auth/logout/", {
        method: "POST",
      });
      if (response.ok) {
        logout();
        navigate("/");
      }
    } catch (error) {
      console.error("Logout failed:", error);
    }
  };

  const testAuth = async () => {
    try {
      const token = localStorage.getItem("accessToken");
      console.log(
        "üîë Testing auth with token:",
        token?.substring(0, 10) + "..."
      );

      const response = await fetch(
        "http://localhost:8000/api/auth/test-auth/",
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );

      const data = await response.json();
      console.log("üîí Protected endpoint response:", data);

      if (response.ok) {
        alert("Authentication successful! Check console for details.");
      } else {
        alert("Authentication failed! Check console for details.");
      }
    } catch (error) {
      console.error("‚ùå Auth test failed:", error);
      alert("Authentication test failed! Check console for details.");
    }
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: "#1a1a1a" }}>
      <Toolbar>
        <DirectionsCarIcon sx={{ fontSize: 32, color: "#ff0000", mr: 2 }} />
        <Typography
          variant="h6"
          component="div"
          sx={{ flexGrow: 1, color: "#ffffff" }}
        >
          The Car Auction Site
        </Typography>
        <Box>
          <Button color="inherit" onClick={() => navigate("/")}>
            Home
          </Button>
          <Button color="inherit">Auctions</Button>
          <Button color="inherit">About</Button>
          {isLoggedIn && (
            <Button color="inherit" onClick={testAuth}>
              Test Auth
            </Button>
          )}
          {isLoggedIn && isAdmin && (
            <Button
              color="inherit"
              startIcon={<AdminPanelSettingsIcon />}
              onClick={() => navigate("/admin")}
            >
              Admin Panel
            </Button>
          )}
          {isLoggedIn ? (
            <Button color="inherit" onClick={handleLogout}>
              Logout
            </Button>
          ) : (
            <Button color="inherit" onClick={() => navigate("/login")}>
              Login
            </Button>
          )}
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
